      desc: "Dịch vụ giao dịch tiền tệ fiat toàn cầu - Nền tảng OTCĐể bảo vệ an toàn của cả hai bên và nâng cao uy tín của người dùng đăng ký trên nền tảng OTC của chúng tôi, nền tảng cung cấp dịch vụ xác minh Người bán cho bạn. Bạn cần cung cấp thông tin cá nhân thật cần thiết để hoàn thành xác minh. Nền tảng có quyền áp dụng mọi biện pháp pháp lý để xác minh thông tin bạn cung cấp. Tuy nhiên, do tính ảo của môi trường mạng và giới hạn của phương thức xác minh, nền tảng không đảm bảo tính chính xác và độ thật của danh tính Người bán đã xác minh.<br/>Các điều khoản liên quan đến tất cả nội dung của thỏa thuận này có liên quan chặt chẽ đến quyền lợi và nghĩa vụ của bạn, vui lòng đọc kỹ tất cả nội dung của thỏa thuận này trước khi bắt đầu đăng ký xác minh. Khi bạn bắt đầu quá trình xác minh, điều này có nghĩa là bạn đã biết, hiểu đầy đủ và đồng ý chấp nhận toàn bộ nội dung của thỏa thuận này.<br/>Ⅰ. Định nghĩa và thay đổi dịch vụ xác minh<br/>1. Dịch vụ xác minh là dịch vụ mà Người bán tận hưởng certain đặc quyền và đảm nhận certain nghĩa vụ trên nền tảng sau khi cung cấp thông tin danh tính thật đáng tin cậy và nộp một số tiền đặt cọc bảo đảm. Trừ khi có trường hợp theo pháp luật hoặc thỏa thuận khác trong thỏa thuận này, sau khi bạn hoàn thành xác minh trên nền tảng, thông tin danh tính tương ứng và kết quả xác minh sẽ không được chỉnh sửa hoặc hủy bỏ vì bất kỳ lý do gì; nếu thông tin danh tính của bạn thay đổi sau khi xác minh hoàn thành, bạn nên cung cấp cho nền tảng giấy chứng nhận do cơ quan tương ứng cấp, và nền tảng sẽ hỗ trợ bạn thay đổi thông tin xác minh.<br/>Để cung cấp dịch vụ tốt hơn và đảm bảo an toàn giao dịch, nền tảng có quyền chỉnh sửa hoặc điều chỉnh nội dung của thỏa thuận này theo thay đổi của điều kiện chủ quan và khách quan, và công bố văn bản thỏa thuận đã thay đổi qua nền tảng mà không cần thông báo riêng. Sau khi thực hiện bất kỳ chỉnh sửa hoặc thay đổi nào đối với thỏa thuận này, nếu bạn tiếp tục sử dụng dịch vụ do nền tảng cung cấp, điều này có nghĩa là bạn đã đọc, hiểu và đồng ý chấp nhận nội dung thỏa thuận đã thay đổi; nếu bạn không đồng ý với nội dung thỏa thuận đã thay đổi, bạn nên ngay lập tức đăng ký hủy dịch vụ xác minh cho nền tảng.<br/>Ⅱ. Quyền lợi của Người bán đã xác minh<br/>1. Nền tảng sẽ cung cấp dấu hiệu Người bán xác minh độc đáo cho Người bán đăng ký xác minh thành công, và dấu hiệu này có thể phân biệt với Người bán chưa xác minh trên nền tảng;<br/>2. Đăng thông tin quảng cáo giao dịch phù hợp với yêu cầu trên nền tảng.<br/>Ⅲ. Thông tin và tiền đặt cọc cần thiết cho xác minh<br/>1. Thông tin cá nhân của Người bán: Vui lòng hoàn thành thông tin đăng ký kinh doanh đính kèm và tải lên.<br/>2. Tiền đặt cọc bảo đảm tài sản: Người bán đăng ký xác minh thành công nên nộp một số tiền đặt cọc cho nền tảng. Tiền đặt cọc sẽ được chuyển vào tài khoản đặt cọc thuộc về Người bán đã xác minh. Người bán đã xác minh không thể xử lý hoặc chuyển tiền trong tài khoản trong một khoảng thời gian nhất định.<br/>Ⅳ. Việc sử dụng tài liệu xác minh<br/>Báo cáo tài liệu xác minh: Các tài liệu xác minh bạn nộp cho nền tảng tại thời điểm xác minh, tức là ủy quyền không thể thu hồi để nền tảng lưu trữ. Ngoại trừ trường hợp theo yêu cầu pháp luật hoặc thỏa thuận trong thỏa thuận này, nền tảng cam kết không chỉnh sửa hoặc công bố tài liệu xác minh của bạn cho bất kỳ bên thứ ba nào và không sử dụng nó cho mục đích thương mại, trừ trường hợp sau:<br/>1. Bạn ủy quyền nền tảng công bố thông tin liên quan;<br/>2. Nền tảng cung cấp cho cơ quan tư pháp và hành chính quốc gia;<br/>3. Nền tảng cung cấp cho các công ty liên kết của nền tảng;<br/>4. Khi bên thứ ba và nền tảng cùng cung cấp dịch vụ cho người dùng, bên thứ ba cung cấp thông tin liên quan cần thiết cho dịch vụ (không bao gồm thông tin tài khoản ngân hàng của bạn);<br/>5. Dựa trên nhu cầu giải quyết tranh chấp dân sự giữa bạn và bên thứ ba, nền tảng có quyền cung cấp thông tin danh tính của bạn cho bên thứ ba.<br/>Ⅴ. Về việc sử dụng tiền đặt cọc<br/>Tiền đặt cọc dùng để bảo đảm các giao dịch liên quan trên nền tảng. Nếu bạn có tranh chấp trong quá trình giao dịch và bạn được xác định là chịu trách nhiệm cho tranh chấp và thực hiện hành vi tương ứng, nhưng bạn không hợp tác, nền tảng có quyền xử lý tiền đặt cọc, bao gồm nhưng không giới hạn于 giữ lại, đóng băng hoặc thanh toán trực tiếp cho bên giao dịch đối diện của bạn.<br/>Ⅵ. Liên kết đến trang web bên thứ ba<br/>Để thực hiện việc kiểm tra thông tin danh tính, nền tảng có thể bao gồm liên kết đến trang web bên thứ ba (ví dụ: trang web ngân hàng trực tuyến) ",
